import './App.css';
import Todo from './Todo';

function Todolist({todos, onDelete, onCompleted}) {  
  return (
    <div>
      <div className="ListOfTodos">
        <table>
          <thead>
            <tr>
              <th>Todo</th>
              <th>Id</th>
              <th>Title</th>

            </tr>
          </thead>
        {todos.map((todo) => (
          <Todo 
            key={todo.id} 
            todo={todo} 
            onDelete={onDelete} 
            onCompleted={onCompleted} />
        ))}
      </table>
      </div>
    </div>
  );
}

export default Todolist;
